import React, { Component } from "react";
const RadioInput = ({ type, id, name, label, value, onChange }) => {
  return (
    <div>
      <label className="login_label" htmlFor={name}>
        {label}
      </label>
      <input
        type={type}
        id={id}
        name={name}
        value={value}
        onChange={onChange}
      />
    </div>
  );
};

export default RadioInput;
